"134":{"department":"PE","number":"134","title":"Synchronized Swimming, Beginning","description":"Students will learn basic skills and techniques associated with synchronized swimming. Students will learn how synchronized swimming is judged alongside some of the basic moves. Sculling with the arms and an 'egg beater' motion with the legs keeps the swimmer stable and allows the more advanced techniques to be performed. This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness, cardiovascular fitness, muscle endurance and flexibility (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle. Prerequisite: intermediate to advanced swimming skills. Fee. (AU)","min_units":1,"max_units":1,"gers":[],"id":207295,"primary":[[{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00 AM","end":"10:50:00 AM","location":"Avery Aquatic Center"}],"id":30072}],[],[]],"primary_type":"Activity"},
