"136":{"department":"PE","number":"136","title":"Swimming: Stroke Refinement","description":"Review and fine tune the 4 competitive strokes (freestyle, backstroke, butterfly, and breaststroke), with a primary emphasis on improving freestyle stroke efficiency.  Flipturn refinement.  Drill and technique work will be heavily emphasized.  On average, 1000 meters will be swum per class.  nPrereq:  Ability to tread deep water for 5 minutes, swim 100 meter intervals of freestyle, backstroke, and breaststroke with rhythmic breathing, and swim 200 meters continuously under 5 minutes.","min_units":1,"max_units":1,"gers":[],"id":214879,"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"10:00:00 AM","end":"10:50:00 AM","location":"Avery Aquatic Center"}],"id":27740}],[],[]],"primary_type":"Activity"},
