"162":{"department":"PE","number":"162","title":"Volleyball","description":"This course is designed to help students gain proficient skills and knowledge of the game of volleyball. This is an introductory course for those with limited or no playing experience. Instruction will include techniques for passing, setting, serving, serve receive, hitting, blocking, digging, and transition. The course is arranged to familiarize students with the rules, terminology, offensive and defensive strategies, team organization, communication, game play, and conditioning for volleyball. This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.","min_units":1,"max_units":1,"gers":[],"id":102713,"primary":[[{"instructors":[],"meeting-times":[{"days":[false,true,false,false,false],"start":"8:00:00 PM","end":"9:50:00 PM","location":""}],"id":25594}],[{"instructors":[],"meeting-times":[{"days":[false,true,false,false,false],"start":"7:00:00 PM","end":"8:50:00 PM","location":""}],"id":19190}],[]],"primary_type":"Activity"},
