"17":{"department":"PE","number":"17","title":"Cardio Dance","description":"Cardio Dance combines traditional aerobic routines with dance-based choreography.  This course will focus on understanding the basic components of cardiovascular fitness, and flexibility. This course will teach students how to properly warm-up, cool-down, stretch and  monitor heart rate as you engage in various styles of dance week to week: swing, salsa, hip-hop, modern, African and Jazz. No experience necessary; just a love of both movement and upbeat music.","min_units":1,"max_units":1,"gers":[],"id":215310,"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:00:00 AM","end":"11:50:00 AM","location":"ArrilagaOutdoorEducRecCtrUpStu"}],"id":29398}],[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:00:00 AM","end":"11:50:00 AM","location":"ArrilagaOutdoorEducRecCtrUpStu"}],"id":19577}],[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:00:00 AM","end":"11:50:00 AM","location":""}],"id":19427}]],"primary_type":"Activity"},
