"175":{"department":"PE","number":"175","title":"Functional Training","description":"Functional Training teaches you how to move your body optimally, improve balance, build strength, and prevent injury.  Class sessions incorporate a variety of exercises that work on flexibility, core, balance, strength and power, focusing on multiple movement planes.  Whether your goal is to train your body to perform the activities of daily life effortlessly and without injury, improve your athletic edge, or regain lost function, this class gives you the tools to achieve these goals.  All fitness levels are welcome.","min_units":1,"max_units":1,"gers":[],"id":215731,"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"7:00:00 PM","end":"7:50:00 PM","location":"ArrilagaOutdoorEducRecCtrUpStu"}],"id":29322}],[],[]],"primary_type":"Activity"},
