"180":{"department":"PE","number":"180","title":"Yoga for Less-stress Living","description":"It is not uncommon in today's world to have a sense of being overtaken by the speed of events. Deadlines, competition, finances, relationships, health challenges all create stress. Stress can be good, but when chronic it can strain the body, cause nervous tension and adversely affect the mind. The stress response is often called fight or flight mode. Its complement is rest and digest.  In this course, we will explore how yogic techniques and breathing can give us the flexibility and strength to maintain a balanced being. All levels are welcome.","min_units":1,"max_units":1,"gers":[],"id":215580,"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"2:15:00 PM","end":"3:05:00 PM","location":"Burnham Pavilion"}],"id":29114}],[],[]],"primary_type":"Activity"},
"181":{"department":"PE","number":"181","title":"YOGA: Beginning","description":"The emphasis of the class is to introduce the values and skills of Hatha Yoga (Yoga of exercise) to the beginning student.  All students will be given the tools to reduce tension, increase energy levels, move efficiently, reconnect to Self-awareness, and learn about your body.  The poses and flows are adaptable and can be personalized for any level of fitness.  Students are encouraged to understand their own limitations and work within their bounds.  The class is designed to take you through a journey of your own body, introducing you to a way of moving with your own inner rhythm.  The emphasis of the class will be on asanas (poses) and vinyasa (flow) for increased flexibility, improved health, relaxation, and reduced stress in daily living.  Class participants will also be exposed to the language, philosophy, history, and concepts of Yoga.  A typical class will include breathing techniques, meditation and asana practice, including standing, balancing, stretching and some inverted poses. This course will utilize class instruction, assignments and student participation to enable students to: (1) Acquire knowledge of the basic components of health and wellness. (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.","min_units":1,"max_units":1,"gers":[],"id":215297,"primary":[[{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","location":"Burnham Pavilion"}],"id":29053}],[],[{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","location":""}],"id":19413}]],"primary_type":"Activity"},
